import React, { Component } from 'react'; 

class Card extends Component {
	constructor (props) {
		super (props); // props include card state (0,1,2) and card id (1-5)
	}
	render () {
		let cardColor = 'black';

		return (
			<td style ={{backgroundColor: cardColor, border: 'solid 1px white' }}></td>
			);
	}
}


export default Card;
